[{'comment_id': 1297821191, 'comment_body': "Maybe let's keep the touch margins, but make them a bit smaller? Point being, it's good to have a bit of space around the buttons when hitting them with your finger on a mobile screen.

```suggestion
        @include touch {
          .docs-navbar-link {
            margin-left: 0.4rem;
            margin-right: 0.4rem;
          }
        }
      }
```

